import React from "react";
import {
    View,
    StyleSheet,
    Text,
    StatusBar
} from 'react-native'

export default function Header(){
    return(
        <View styles={styles.container}>
            <Text>Headerzinha</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container:{
        backgroundColor: '#800ff',
    }
})
